import React from 'react';
import ServiceCard from './ServiceCard';
import './ServiceOverview.css';

const services = [
  {
    title: 'Custom Web Development',
    description:
      'We build responsive, scalable websites tailored to your business needs.',
    metric: '500+ Projects Delivered',
    icon: 'path/to/icon1.svg',
  },
  {
    title: 'SaaS Solutions',
    description:
      'Our SaaS solutions help streamline your business operations.',
    metric: '100+ SaaS Applications Launched',
    icon: 'path/to/icon2.svg',
  },
  {
    title: 'E-Commerce Development',
    description:
      'Create powerful online stores with our e-commerce development services.',
    metric: '250+ E-Commerce Sites Built',
    icon: 'path/to/icon3.svg',
  },
];

const ServiceOverview = () => {
  return (
    <section className="service-overview">
      <h2 className="section-title">Our Services</h2>
      <p className="section-description">
        Explore our innovative and scalable web development and SaaS
        solutions.
      </p>
      <div className="services-grid">
        {services.map((service, index) => (
          <ServiceCard
            key={index}
            title={service.title}
            description={service.description}
            metric={service.metric}
            delay={index * 100}
            serviceType={service.title} // Use the service title to determine the icon
          />
        ))}
      </div>
    </section>
  );
};

export default ServiceOverview;
